  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Roanoke
  River National Wildlife Refuge summarizes Refuge activities during the 1995 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Land acquisition is also covered.  The report includes a planning section
  which discusses research and investigations.  Refuge administration is outlined;
  information about personnel, volunteer programs, funding, safety, and technical
  assistance is given.  Habitat management is also covered.  Subjects include wetlands
  and Farmeru2019s Home Administration Conservation Easements.  The wildlife section
  of the report discusses wildlife diversity, endangered species, threatened species,
  waterfowl, marsh birds, water birds, raptors, game mammals, fisheries resources,
  and marking/banding.  The public uses of the Refuge described in this report include
  hunting, camping, and law enforcement.  The equipment and facilities section of
  the report provides information about major maintenance and communications systems.
  \ Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
